import React, { Component } from 'react';

class App extends Component {
   
   
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <a
            className="App-link"
            href="./public/show.html"
            target="_blank"
            rel="noopener noreferrer"
          >
            Посмотреть фильм
          </a>
        </header>
      </div>
    );
  }
}

export default App;
